import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const AsideBar = () => {

    useEffect(()=>{

    }, [])

    return (
       <div  className="list-group">
           <ul>
           		<li> <Link to="/django-demo-app"  className="list-group-item list-group-item-action">Explain Basic Django App</Link> </li>
           		<li> <Link to="/math-for-developers" className="list-group-item list-group-item-action"> What are the math concepts  I should know it as a developer ?</Link> </li>
           		<li> <Link to="/mercure-protocol-with-symfony" className="list-group-item list-group-item-action"> How ro use Mercure Protocol with Symfony and API Platform ?</Link> </li>
           		<li> <Link to="/node-express-app" className="list-group-item list-group-item-action">Hello World Express application using Sequelize </Link> </li>
           		<li> <Link to="/symfony-react" className="list-group-item list-group-item-action"> How to use Symfony and React in the same project ?</Link> </li>
           </ul>
       </div> 
    );
};

export default AsideBar;
